    false,nt"url": null,nt"notes": "Recovery of the lower Columbia population
    of Columbian White-tailed Deer (CWTD) relies on specific population goals.  As such,
    monitoring programs cannot be based on trend analysis or indices, but must yield
    population estimates.  In addition, the primary purpose for JBH is CWTD, and the
    Refuge is intensively managed to increase or maintain CWTD population levels.  Assessing
    the population is critical to understanding whether our management actions are affecting
    CWTD numbers.  These numbers will also be used to defend the current downlisting
    proposal any delisting proposal that may occur in the future.",nt"license_title":
